# ==========================================


def upload_and_send_document():
    # 1 Decode Base64  temp file
    temp_file = f"{uuid.uuid4()}.pdf"

    with open(temp_file, "wb") as f:
        f.write(base64.b64decode(BASE64_STRING))

    # 2 Upload media
    media_url = f"https://graph.facebook.com/{API_VERSION}/{PHONE_NUMBER_ID}/media"
    headers = {
        "Authorization": f"Bearer {ACCESS_TOKEN}"
    }

    files = {
        "file": (FILENAME, open(temp_file, "rb"), "application/pdf")
    }

    data = {
        "messaging_product": "whatsapp",
        "type": "application/pdf"
    }

    media_resp = requests.post(media_url, headers=headers, files=files, data=data)
    media_resp.raise_for_status()

    media_id = media_resp.json()["id"]
    print("Uploaded media_id:", media_id)

    # 3 Send document message
    message_url = f"https://graph.facebook.com/{API_VERSION}/{PHONE_NUMBER_ID}/messages"
    headers = {
        "Authorization": f"Bearer {ACCESS_TOKEN}",
        "Content-Type": "application/json"
    }

    payload = {
        "messaging_product": "whatsapp",
        "recipient_type": "individual",
        "to": TO_PHONE,
        "type": "document",
        "document": {
            "id": media_id,
            "filename": FILENAME
        }
    }

    msg_resp = requests.post(message_url, headers=headers, json=payload)
    msg_resp.raise_for_status()

    print("Message sent successfully")



if __name__ == "__main__":
    upload_and_send_document()
